package com.maximuscooke.app.soccerboss;

public class CClubException extends Exception
{

	/**
	 * 
	 */
	private static final long serialVersionUID = 2385143598938005221L;

	public CClubException()
	{
		// TODO Auto-generated constructor stub
	}

	public CClubException(String message)
	{
		super(message);
	}

	public CClubException(Throwable cause)
	{
		super(cause);
	}

	public CClubException(String message, Throwable cause)
	{
		super(message, cause);
	}

	public CClubException(String message, Throwable cause, boolean enableSuppression, boolean writableStackTrace)
	{
		super(message, cause, enableSuppression, writableStackTrace);
	}
}
